import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
function Plan() {
  const [getplan, setPlan] = useState({});

  useEffect(() => {
    async function getAllPlan() {
      try {
        const plandata = await axios.get("http://127.0.0.1:8000/list/");

        console.log(plandata);
        setPlan(plandata.data);
      } catch (error) {
        console.log(error);
      }
    }
    getAllPlan();
  }, []);
  <h1>Connect with Django</h1>;
  return (
    <div>
      <h6>Item List Data from Django</h6>

      {getplan.map((items, i) => (
        <div>
          <table class="table table-dark">
            <thead>
              <tr>
                <th scope="col">ID</th>
                <th scope="col">Item</th>
              </tr>
            </thead>

            <tbody>
              <tr>
                <th scope="row">{items.id}</th>
                <th scope="row">{items.item}</th>
              </tr>
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
}

export default Plan;
